import React from "react";

import ExpenseForm from "./expenseForm";
import "./newExpense.css"

const NewExpense = () => {         
    const SaveExpenseDataHandler = (enteredExpenseData) => {
        const expenseData = {
            ...enteredExpenseData,
            id: Math.random().toString()
        };
        console.log(expenseData);
    }                                             //u redu 15 gde prosledjujemo podatke u ExpenseForm, smo takodje dodali onSaveExpenseData={}, koja ce imati kao vrednost neku funkciju, koja ce se pozvati unutar ExpenseForm komponente; nema potrebe da onSaveExpenseData pocinje sa on, ali smo tako stavili kako bi nama bilo prepoznatljivije
    return <div className="new-expense">
        <ExpenseForm onSaveExpenseData={SaveExpenseDataHandler}/>                
        <form></form>
    </div>
}

export default NewExpense;
